Island Fever 4
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Experience A Place Where Your Wildest Fantasies...Are Only The BeginningFrom Joone, the award-winning director of Pirates, comes Island Fever 4. Shot entirely in HD on location in the Bahamas and Bora Bora and delivered on a special triple-disc set, Island Fever 4 stars Jesse Jane, Teagan Presley, Jana Cova, Sophia Santi, Kinzie Kenner and Marie Luv. With 16 full blown sex scenes including 10 throbbing boy / girls, 5 juicy girl / girls and an insane all-girl orgy, plus a dozen solo se-quences, this remarkable production is over 3 hours long and features an additional 2 hours of bonus material and special features.

Cast: Jesse Jane   Teagan Presley   Sophia Santi   Jana Cova   Evan Stone   Tommy Gunn   Marie Luv   Kinzie Kenner   Scott Nails   Marco Banderas   Jean Val Jean

